import home from "../img/home.svg"
import swap from "../img/swap.svg"
import liquidity from "../img/liquidity.svg"

export const MenuItems = [
  {
    title: "Home",
    url: "/",
    cName: "nav-links",
    img: home,
  },
  {
    title: "Swap",
    url: "/GrimaceSwap/",
    cName: "nav-links",
    img: swap
  },
  {
    title: "Liquidity",
    url: "/GrimaceSwap/liquidity",
    cName: "nav-links",
    img: liquidity
  },
];
